import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { 
  Box, 
  Grid, 
  Card, 
  CardContent, 
  Typography, 
  CircularProgress,
  LinearProgress,
  Avatar,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  Divider,
  Button
} from '@mui/material';
import {
  People as PeopleIcon,
  Home as HomeIcon,
  Message as MessageIcon,
  AttachMoney as MoneyIcon,
  TrendingUp as TrendingUpIcon,
  AccessTime as TimeIcon,
  ArrowForward as ArrowForwardIcon
} from '@mui/icons-material';
import { format } from 'date-fns';
import api from '../../services/api';
import { Tabs, Tab, TabPanel } from './AdminDashboardTabs';
import UserManagement from './UserManagement';
import AdminMessages from './AdminMessages';
import UserPosts from './UserPosts';
import LoadingSpinner from '../../components/common/LoadingSpinner';
import { FiUsers, FiMessageSquare, FiFileText } from 'react-icons/fi';

const StatCard = ({ title, value, icon: Icon, color, trend, trendText }) => (
  <Card elevation={2}>
    <CardContent>
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <Box>
          <Typography color="textSecondary" variant="subtitle2" gutterBottom>
            {title}
          </Typography>
          <Typography variant="h4" component="div">
            {value}
          </Typography>
          {trend && (
            <Box display="flex" alignItems="center" mt={1}>
              <Box 
                component="span" 
                color={trend > 0 ? 'success.main' : 'error.main'}
                display="flex"
                alignItems="center"
                fontSize="0.875rem"
              >
                {trend > 0 ? '↑' : '↓'} {Math.abs(trend)}%
                <Box component="span" ml={0.5} color="text.secondary">
                  {trendText}
                </Box>
              </Box>
            </Box>
          )}
        </Box>
        <Box
          sx={{
            backgroundColor: `${color}.light`,
            color: `${color}.dark`,
            borderRadius: '12px',
            height: '48px',
            width: '48px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}
        >
          <Icon fontSize="medium" />
        </Box>
      </Box>
    </CardContent>
  </Card>
);

const ActivityItem = ({ activity }) => {
  const getIcon = () => {
    switch (activity.type) {
      case 'property':
        return <HomeIcon color="primary" />;
      case 'user':
        return <PeopleIcon color="secondary" />;
      case 'message':
        return <MessageIcon color="info" />;
      default:
        return <TimeIcon color="disabled" />;
    }
  };

  return (
    <>
      <ListItem alignItems="flex-start" sx={{ py: 1.5, px: 0 }}>
        <ListItemAvatar>
          <Avatar sx={{ bgcolor: 'action.hover' }}>
            {getIcon()}
          </Avatar>
        </ListItemAvatar>
        <ListItemText
          primary={
            <Typography variant="body2" component="span" color="text.primary">
              <Typography component="span" fontWeight="medium">
                {activity.user}
              </Typography>{' '}
              {activity.action}
            </Typography>
          }
          secondary={
            <Typography variant="caption" color="text.secondary" display="flex" alignItems="center">
              <TimeIcon fontSize="inherit" sx={{ mr: 0.5 }} />
              {activity.time}
            </Typography>
          }
        />
      </ListItem>
      <Divider variant="inset" component="li" />
    </>
  );
};

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalProperties: 0,
    totalMessages: 0,
    totalRevenue: 0,
    userGrowth: 12.5,
    propertyGrowth: 8.2,
    revenueGrowth: 5.7
  });
  const [recentActivity, setRecentActivity] = useState([]);
  const [loading, setLoading] = useState(true);
  const [tabValue, setTabValue] = useState(0);
  const { user } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // In a real app, you would fetch this data from your API
        const [statsRes, activityRes] = await Promise.all([
          api.get('/api/admin/stats'),
          api.get('/api/admin/activity')
        ]);
        
        setStats({
          totalUsers: 1245,
          totalProperties: 856,
          totalMessages: 342,
          totalRevenue: 12500,
          userGrowth: 12.5,
          propertyGrowth: 8.2,
          revenueGrowth: 5.7
        });

        setRecentActivity([
          { 
            id: 1, 
            user: 'John Doe', 
            action: 'created a new property listing', 
            time: '10 minutes ago', 
            type: 'property' 
          },
          { 
            id: 2, 
            user: 'Jane Smith', 
            action: 'sent a message about a property', 
            time: '25 minutes ago', 
            type: 'message' 
          },
          { 
            id: 3, 
            user: 'Mike Johnson', 
            action: 'signed up for an account', 
            time: '1 hour ago', 
            type: 'user' 
          },
          { 
            id: 4, 
            user: 'Sarah Williams', 
            action: 'purchased a premium listing', 
            time: '2 hours ago', 
            type: 'property' 
          },
          { 
            id: 5, 
            user: 'Alex Brown', 
            action: 'contacted support', 
            time: '3 hours ago', 
            type: 'message' 
          },
        ]);

        setLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  useEffect(() => {
    // Redirect if not admin
    if (user?.role !== 'admin') {
      navigate('/');
    }
  }, [user, navigate]);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        Dashboard Overview
      </Typography>
      
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Users" 
            value={stats.totalUsers.toLocaleString()} 
            icon={PeopleIcon} 
            color="primary"
            trend={stats.userGrowth}
            trendText="vs last month"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Properties" 
            value={stats.totalProperties.toLocaleString()} 
            icon={HomeIcon} 
            color="secondary"
            trend={stats.propertyGrowth}
            trendText="vs last month"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Messages" 
            value={stats.totalMessages.toLocaleString()} 
            icon={MessageIcon} 
            color="info"
            trend={-3.1}
            trendText="vs last week"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Revenue" 
            value={`$${stats.totalRevenue.toLocaleString()}`} 
            icon={MoneyIcon} 
            color="success"
            trend={stats.revenueGrowth}
            trendText="vs last month"
          />
        </Grid>
      </Grid>

      <Grid container spacing={3}>
        <Grid item xs={12} md={8}>
          <Card elevation={2}>
            <Box p={3}>
              <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
                <Typography variant="h6" component="h2">
                  Recent Activity
                </Typography>
                <Button 
                  size="small" 
                  endIcon={<ArrowForwardIcon />}
                  onClick={() => navigate('/admin/activity')}
                >
                  View All
                </Button>
              </Box>
              <List sx={{ width: '100%', bgcolor: 'background.paper' }}>
                {recentActivity.map((activity) => (
                  <ActivityItem key={activity.id} activity={activity} />
                ))}
              </List>
            </Box>
          </Card>
        </Grid>
        
        <Grid item xs={12} md={4}>
          <Card elevation={2}>
            <Box p={3}>
              <Typography variant="h6" component="h2" gutterBottom>
                Quick Actions
              </Typography>
              <Box sx={{ '& > *': { mb: 1.5 } }}>
                <Button 
                  fullWidth 
                  variant="outlined" 
                  startIcon={<PeopleIcon />}
                  onClick={() => navigate('/admin/users')}
                >
                  Manage Users
                </Button>
                <Button 
                  fullWidth 
                  variant="outlined" 
                  startIcon={<HomeIcon />}
                  onClick={() => navigate('/admin/properties')}
                >
                  Manage Properties
                </Button>
                <Button 
                  fullWidth 
                  variant="outlined" 
                  startIcon={<MessageIcon />}
                  onClick={() => navigate('/admin/messages')}
                >
                  View Messages
                </Button>
                <Button 
                  fullWidth 
                  variant="outlined" 
                  startIcon={<TrendingUpIcon />}
                  onClick={() => navigate('/admin/analytics')}
                >
                  View Analytics
                </Button>
              </Box>
              
              <Box mt={4}>
                <Typography variant="subtitle2" gutterBottom>
                  System Status
                </Typography>
                <Box mb={2}>
                  <Box display="flex" justifyContent="space-between" mb={0.5}>
                    <Typography variant="body2">Server Load</Typography>
                    <Typography variant="body2">24%</Typography>
                  </Box>
                  <LinearProgress variant="determinate" value={24} color="primary" />
                </Box>
                <Box>
                  <Box display="flex" justifyContent="space-between" mb={0.5}>
                    <Typography variant="body2">Database</Typography>
                    <Typography variant="body2">Connected</Typography>
                  </Box>
                  <LinearProgress variant="determinate" value={100} color="success" />
                </Box>
              </Box>
            </Box>
          </Card>
        </Grid>
      </Grid>

      <Box sx={{ width: '100%', minHeight: 'calc(100vh - 64px)' }}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider', bgcolor: 'background.paper' }}>
          <Tabs 
            value={tabValue} 
            onChange={handleTabChange}
            variant="scrollable"
            scrollButtons="auto"
            aria-label="admin dashboard tabs"
          >
            <Tab 
              icon={<FiUsers size={20} style={{ marginBottom: 4 }} />} 
              label="Users"
              iconPosition="start"
            />
            <Tab 
              icon={<FiMessageSquare size={20} style={{ marginBottom: 4 }} />} 
              label="Messages"
              iconPosition="start"
            />
            <Tab 
              icon={<FiFileText size={20} style={{ marginBottom: 4 }} />} 
              label="User Posts"
              iconPosition="start"
            />
          </Tabs>
        </Box>

        <TabPanel value={tabValue} index={0}>
          <UserManagement />
        </TabPanel>
        <TabPanel value={tabValue} index={1}>
          <AdminMessages />
        </TabPanel>
        <TabPanel value={tabValue} index={2}>
          <UserPosts />
        </TabPanel>
      </Box>
    </Box>
  );
};

export default AdminDashboard;
